import React from 'react';
import PropTypes from 'prop-types';

import Button from '../Button/Button';
import './Task.scss'

const Task = ({ clicked }) => {
    return (
        <div className='task'>
            <h3>Пользователь может редактировать задачи</h3>
            <Button clicked={clicked}>
                Edit
            </Button>
        </div>
    );
};

Task.propTypes = {
    clicked: PropTypes.func.isRequired
};

export default Task;
